import { Component } from "react";
import Card from "./Card";
import "./card.css";
class CardList extends Component {
  render() {
    const { monsters } = this.props;
    console.log(monsters);
    return (
      <div className="card-list">
        <Card monsters={monsters} />
      </div>
    );
  }
}

export default CardList;
